void dotHandler() {
	if(isFloat ==0){
		digitNumber++;
		isFloat = 1;
	}
}
void zeroHandler() {
	if (number != 0.0f) {
		if (isFloat) {
			fractionCount--;
		}
		else{
			number = number * 10.0;
		}

		digitNumber++;
	}
}
void enterHandler() {
	number = 0;
	digitNumber = 0;
	isFloat = 0;
	fractionCount = 0;
	state = EXPMENU;
}
void removeHandler() {
	if (isFloat) {
		int removedDigit = (number * pow(10, -fractionCount));
		number = number - removedDigit * (10, fractionCount);
	}
	else{
		int removedDigit = (int) number % 10;
		number = number / 10.0f;
		number = number - (0.1f * removedDigit);
	}
	digitNumber--;
}
